import SwiftUI

struct WoodImage {
    static func createTexture() -> UIImage {
        #if true
        let textureString = ""
        #else
        let textureString = ""
        #endif

        let imageData = Data(base64Encoded: textureString)
        return UIImage(data: imageData!)!
    }
}

struct WoodView: View {
    let texture = WoodImage.createTexture()

    var body: some View {
        Image(uiImage: texture)
    }
}

struct WoodView_Previews: PreviewProvider {
    static var previews: some View {
        WoodView()
    }
}
